import React from 'react';
import {Card,CardDeck} from 'react-bootstrap';
import donations from './donations.jpg';
import doctors from './doctors.jpg';
import './style.scss';

const Data =() =>{

  return(

    <CardDeck>
  <Card className="dim">
  <Card.Img className="img" variant="top" src={donations} />
    <Card.Body>
      <h3>Donations</h3>
      <h4>$10000</h4>
    </Card.Body>
  </Card>
  <Card className="dim">
  <Card.Img className="img" variant="top" src={doctors} />
    <Card.Body>
    <h3>Doctors and Health Care Workers</h3>
      <h4>1500</h4>
    </Card.Body>
  </Card>
  <Card className="dim">
    <Card.Body>
    <h3>Patients</h3>
      <h4>2000</h4>
    </Card.Body>
  </Card>
</CardDeck>
  );

}

export default Data;
